import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const Homepage = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,
  };

  const imageStyle = {
    height: '400px',  // Set a fixed height for each image
    objectFit: 'cover',
  };

  return (
    <div style={{ margin: '12px', height: '400px' }}>
      <Slider {...settings}>
        <img src="cow1.jpg" alt="Cow 1" style={imageStyle} />
        <img src="cow2.jpg" alt="Cow 2" style={imageStyle} />
        <img src="cow3.jpg" alt="Cow 3" style={imageStyle} />
      </Slider>
    </div>
  );
};

export default Homepage;
